let style = {
    width: 100,
    height: 30,
    backgroundColor: "#063b50",
    borderRadius: '5px 5px',
    cursor: 'pointer',
}

let settingsLine = {
    width: 18,
    height: 1,
    backgroundColor: '#e4f7ff',
    margin: 'auto'
}

export default function Settings() {
    return (
        <div style={style}>
            <div style={{paddingTop: 10}}>
                <div style={settingsLine}></div>
                <div style={{...settingsLine, marginTop: 4}}></div>
                <div style={{...settingsLine, marginTop: 4}}></div>
            </div>
        </div>
    )
}
